import React from 'react';
import InputSetting from '../../UI/InputSetting/InputSetting'
import classes from './FormSetting.module.css'

const FormTimerSetting = ({tittle,value,time,add,remove}) => {
  return (
  <div className={classes.timer_setting}>
    <span>{tittle}</span>
    <InputSetting value={value}time={time} add={add} remove={remove}/>
  </div>

  );
};

export default FormTimerSetting;
